import React from "react";
import Card from "./card";
 const Alpha = ()=>{
    const letters= ['A','B','C','D','E','F','G'];
    return (
        <div>
            {
                letters.map(letter=>{
                   return  <Card letter={letter}/>
                })
            }
        </div>
    );
 }
 export default Alpha
